import React, { Component } from 'react';
import './App.css';
import './components/layout/Navbar';
import Navbar from './components/layout/Navbar';

class App extends Component {
  render() {
    return (
      <navbar className='navbar bg-primary'>
        <Navbar title='Github Finder' />
      </navbar>
    );
  }
}
export default App;
